const t=JSON.parse('{"key":"v-62bb3f1c","path":"/posts/datastructure_algorithm/insert-sort.html","title":"直接插入排序分析","lang":"zh-CN","frontmatter":{"category":["data structure"],"tag":["data structure"],"description":"直接插入排序分析 过程分析 插入排序是比较好理解的排序算法之一，其原理类似于打扑克排的理牌。 打扑克牌时，我们会依次抓牌并理牌，在理牌的过程中，我们会根据牌的大小确定在那个位置将牌插入进去。 插入排序的原理是类似的，其过程如下所示： 1.第一个元素可以跳过，因为单个元素始终是有序的。 2.取出下一个元素，向前进行扫描。 3.如果该元素大于向前扫描的元素，则将元素移动到下一个位置 4.重复步骤3，扫描到的元素小于等于新元素 5.将元素插入到该位置 6.重复步骤2-5","head":[["meta",{"property":"og:url","content":"https://mister-hope.github.io/posts/datastructure_algorithm/insert-sort.html"}],["meta",{"property":"og:site_name","content":"Code Building"}],["meta",{"property":"og:title","content":"直接插入排序分析"}],["meta",{"property":"og:description","content":"直接插入排序分析 过程分析 插入排序是比较好理解的排序算法之一，其原理类似于打扑克排的理牌。 打扑克牌时，我们会依次抓牌并理牌，在理牌的过程中，我们会根据牌的大小确定在那个位置将牌插入进去。 插入排序的原理是类似的，其过程如下所示： 1.第一个元素可以跳过，因为单个元素始终是有序的。 2.取出下一个元素，向前进行扫描。 3.如果该元素大于向前扫描的元素，则将元素移动到下一个位置 4.重复步骤3，扫描到的元素小于等于新元素 5.将元素插入到该位置 6.重复步骤2-5"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-06-26T02:23:51.000Z"}],["meta",{"property":"article:tag","content":"data structure"}],["meta",{"property":"article:modified_time","content":"2023-06-26T02:23:51.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"直接插入排序分析\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-06-26T02:23:51.000Z\\",\\"author\\":[]}"]]},"headers":[{"level":2,"title":"过程分析","slug":"过程分析","link":"#过程分析","children":[]},{"level":2,"title":"代码实现","slug":"代码实现","link":"#代码实现","children":[]},{"level":2,"title":"稳定性分析","slug":"稳定性分析","link":"#稳定性分析","children":[]}],"git":{"createdTime":1687704155000,"updatedTime":1687746231000,"contributors":[{"name":"zgjsxx","email":"119160524@qq.com","commits":2}]},"readingTime":{"minutes":1.55,"words":466},"filePathRelative":"posts/datastructure_algorithm/insert-sort.md","localizedDate":"2023年6月25日","excerpt":"<h1> 直接插入排序分析</h1>\\n<h2> 过程分析</h2>\\n<p>插入排序是比较好理解的排序算法之一，其原理类似于打扑克排的理牌。</p>\\n<p>打扑克牌时，我们会依次抓牌并理牌，在理牌的过程中，我们会根据牌的大小确定在那个位置将牌插入进去。</p>\\n<p>插入排序的原理是类似的，其过程如下所示：</p>\\n<ul>\\n<li>1.第一个元素可以跳过，因为单个元素始终是有序的。</li>\\n<li>2.取出下一个元素，向前进行扫描。</li>\\n<li>3.如果该元素大于向前扫描的元素，则将元素移动到下一个位置</li>\\n<li>4.重复步骤3，扫描到的元素小于等于新元素</li>\\n<li>5.将元素插入到该位置</li>\\n<li>6.重复步骤2-5</li>\\n</ul>","autoDesc":true}');export{t as data};
